                >
                  <MDTypography variant="gradient" fontSize="60%" color="white" id="baAccName">
                    {" "}
                  </MDTypography>
                  <MDTypography variant="gradient" fontSize="60%" color="white" id="baAccNo">
                    {" "}
                  </MDTypography>
                </MDBox>
                <MDBox mb={2}>
                  <Container>
                    <div className="row">
                      <div className="col-sm-8">
                        <MDTypography variant="button" fontWeight="regular" color="text" mt={2}>
                          Bank
                        </MDTypography>
                        <MDBox textAlign="right">
                          <Form.Select
                            value={baBankx || ""}
                            aria-label="Default select example"
                            onChange={handleOnChangeBank}
                          >
                            <option value="1">--Select Bank--</option>
                            {allBanks.map((api) => (
                              <option key={api.code} value={api.name}>
                                {api.name}
                              </option>
                            ))}
                          </Form.Select>
                        </MDBox>
                      </div>
                    </div>
                  </Container>
                  <Container>
                    <div className="row">
                      <div className="col-sm-8">
                        <MDTypography variant="button" fontWeight="regular" color="text" mt={3}>
                          Bank Country
                        </MDTypography>
                        <MDBox textAlign="right">
                          <Form.Select
                            value={baCountryx || ""}
                            aria-label="Default select example"
                            onChange={handleOnChangeBaCountry}
                          >
                            <option>--Select Country--</option>
                            {WCountries.map((apic) => (
                              <option key={apic.code} value={apic.name}>
                                {apic.name}
                              </option>
                            ))}
                          </Form.Select>
                        </MDBox>
                      </div>
                    </div>
                  </Container>
                </MDBox>
                <MDBox mb={2}>
                  <Container>
                    <div className="row">
                      <div className="col-sm-8">
                        <MDInput
                          type="text"
                          label="Account Number"
                          value={baAcctNox || ""}
                          onKeyUp={handleOnBAAccNoKeys}
                          onChange={(e) => setBaAcctNo(e.target.value)}
                          variant="standard"
                          fullWidth
                        />
                      </div>
                    </div>
                  </Container>
                </MDBox>
                <MDBox mb={2}>
                  <Container>
                    <div className="row">
                      <div className="col-sm-8">
                        <MDInput
                          type="email"
                          label="Account Name"
                          value={baAcctNamex || ""}
                          onKeyUp={handleOnBAAccNameKeys}
                          onChange={(e) => setBaAcctName(e.target.value)}
                          variant="standard"
                          fullWidth
                        />
                      </div>
                    </div>
                  </Container>
                </MDBox>
                <div align="center">
                  <MDBox mt={4} mb={1}>
                    <MDButton
                      variant="gradient"
                      onClick={handleBAAddUpdate}
                      color="info"
                      width="50%"
                    >
                      Save
                    </MDButton>
                  </MDBox>
                </div>
              </MDBox>
            </MDBox>
          </Card>
          &nbsp;
          <Card>
            <MDBox pt={4} pb={3} px={3}>
              <MDBox component="form" role="form">
                <MDBox
                  variant="gradient"
                  bgColor="info"
                  borderRadius="lg"
                  coloredShadow="success"
                  mx={2}
                  mt={-6}
                  p={2}
                  mb={1}
                  textAlign="center"
                >
                  <MDTypography
                    variant="h4"
                    fontWeight="medium"
                    color="white"
                    textAlign="center"
                    mt={1}
                  >
                    Medical
                  </MDTypography>
                </MDBox>
                <MDBox
                  variant="gradient"
                  bgColor="error"
                  borderRadius="lg"
                  coloredShadow="success"
                  mx={3}
                  mt={1}
                  p={1}
                  mb={5}
                  textAlign="center"
                />
                <Container>
                  <div className="row">
                    <div className="col-sm-8">
                      <MDTypography variant="button" fontWeight="regular" color="text" mt={2}>
                        Blood Group
                      </MDTypography>
                      <MDBox mb={2}>
                        <Form.Select
                          onChange={(e) => setMeBloodGroup(e.target.value)}
                          value={meBloodGroupx || ""}
                          aria-label="Default select example"
                        >
                          <option>---Blood Group---</option>
                          <option value="A+">A+</option>
                          <option value="A-">A-</option>
                          <option value="B+">B+</option>
                          <option value="B-">B-</option>
                          <option value="AB+">AB+</option>
                          <option value="AB-">AB-</option>
                          <option value="O+">O+</option>
                          <option value="O-">O-</option>
                        </Form.Select>
                      </MDBox>
                    </div>
                  </div>
                </Container>
                <Container>
                  <div className="row">
                    <div className="col-sm-8">
                      <MDTypography variant="button" fontWeight="regular" color="text" mt={2}>
                        Genotype
                      </MDTypography>
                      <MDBox mb={2}>
                        <Form.Select
                          onChange={(e) => setMeGenotype(e.target.value)}
                          value={meGenotypex || ""}
                          aria-label="Default select example"
                        >
                          <option>---Genotype---</option>
                          <option value="AA">AA</option>
                          <option value="AS">AS</option>
                          <option value="AC">AC</option>
                          <option value="SS">SS</option>
                        </Form.Select>
                      </MDBox>
                    </div>
                  </div>
                </Container>
                <div align="center">
                  <MDBox mt={4} mb={1}>
                    <MDButton
                      variant="gradient"
                      onClick={handleMEAddUpdate}
                      color="info"
                      width="50%"
                    >
                      Save
                    </MDButton>
                  </MDBox>
                </div>
              </MDBox>
            </MDBox>
          </Card>
        </div>
      </div>
      &nbsp;
      <MDBox>
        <DataTable
          table={{ columns: pColumns, rows: items }}
          isSorted
          entriesPerPage
          showTotalEntries
          noEndBorder
          canSearch
        />
      </MDBox>
      <Footer />
      <Backdrop sx={{ color: "#fff", zIndex: (theme) => theme.zIndex.drawer + 1 }} open={opened}>
        <CircularProgress color="info" />
      </Backdrop>
    </DashboardLayout>
  );
}

export default UserProfile;
